  <Reset />;
  return (
    <div class="container">
      <h1>Breadcrumb</h1>
      <ol class="breadcrumb">
        <li class="item">Home</li>
        <li class="item">Level 1</li>
        <li class="item">Level 2</li>
      </ol>
    </div>
  );
};

export default Bread;
